import { Component, OnInit } from '@angular/core';


@Component({
  selector: 'app-homefront',
  templateUrl: './homefront.component.html',
  styleUrls: ['./homefront.component.css']
})
export class HomefrontComponent implements OnInit {
  modules: any[] = []; // Define a variable to hold the module data

  constructor(private moduleService: ModuleService) { }

  ngOnInit(): void {
    // Fetch module data from backend when component initializes
    this.moduleService.getModules().subscribe((data: any) => {
      this.modules = data; // Assign module data to the modules array
    });
  }
}
